import './App.scss';
import Navbar from './components/nav';
import Main from './components/main';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Router>
      <Navbar></Navbar>
      <Switch>
            <Route path="/education">
              {/* <Education /> */}
            </Route>
            <Route path="/contact">
              {/* <Contact /> */}
            </Route>
            <Route path="/">
              <Main />
            </Route>
      </Switch>
      </Router>

      </header>
    </div>
  );
}

export default App;
